In 1958, four hot shot test pilots seem certain to be the first men to go into outer space. However, the back-stabbing leader of their organization disbands them to prevent their involvement in the then forming NASA and labels them as non-team players. Flash forward to the present, the foursome are now living a docile life. The electrical engineer has a pleasant retired life in a desert home with his wife. The pilot, who had a penchant for pushing the test planes to their limits, is now a daredevil crop-duster. The navigator is a Baptist minister. The designer is a womanizing roller coaster designer. Their former boss is now a mission leader in Nasa and still as despicable as in his younger days. It is here that the main story begins. It seems that an old Russian &quot;communications&quot; satellite is about to crash back into the Earth's atmosphere and somehow American technology designed by Eastwood's character has ended up as the guiding system... 


